import React from 'react'
import Content from './Content'
import dinner from './dinner.jpg'

export default class MainContainer extends React.Component {

    state = {
        allMeals: [],
        sessionUser: [],
        randomMeal: [],
        sessionOrder: [],
        logged: false
    }

    logIn = () => {
        this.setState({logged: true})
    }

    componentDidMount(){
        fetch('http://localhost:3000/meals')
          .then(res => res.json())
          .then(data => console.log(data));
    }


    render() {
        console.log(this.state.logged, this.state.allMeals)

        return (
            <div style={{ backgroundImage:`url(${dinner})` }}>
                <Content key={"content"} sessionUser={this.state.sessionUser} allMeals={this.state.allMeals} logged={this.state.logged} logIn={this.logIn}/>
            </div>
        )
    }

}
